    username: "foo",
    password: "changeme",
    enabled: true,
});
// Create a new rancher2 global_role_binding for User
const fooGlobalRoleBinding = new rancher2.GlobalRoleBinding("fooGlobalRoleBinding", {
    globalRoleId: "user-base",
    userId: fooUser.id,
});
```
